import React from "react";
import Estilo from "../Hojas de Estilos/ItemMenu.css";
function ItemMenu({ link, setActivo, setNavegacion}){
    const navegacion = (e)=>{
        e.preventDefault();
        const sectionId = this.getAttribute('href').substring(1);
        setNavegacion(sectionId);
        setActivo();
    }
    return(
        <a className={link.Activo? "item-menu activo" : "item-menu" } onClick={navegacion()} href={link.Nombre}>
            {link.Nombre}
        </a>
    );
}
export default ItemMenu;
